TABLEATTRIBUTE.VALUE:
EXEC sp_ETL_MERGE_Load 'MERGE_WC_ACTIVITY_F';
UPDATE WC_ACTIVITY_F SET WC_ACTIVITY_F.ATTRIB_122 = SUBSTRING(LOV_STATUS.[NAME],0,30) , WC_ACTIVITY_F.ATTRIB_119 = PAR.ATTRIB_116, WC_ACTIVITY_F.ATTRIB_117 = PAR.ATTRIB_114, WC_ACTIVITY_F.ATTRIB_118 = PAR.ATTRIB_115, WC_ACTIVITY_F.ATTRIB_120 = PAR.ACTUAL_START_DT, WC_ACTIVITY_F.ATTRIB_121 = PAR.ACTUAL_END_DT, WC_ACTIVITY_F.ATTRIB_111 = SUBSTRING(LOV_TYPE_CD.NAME,0,30) FROM WC_ACTIVITY_F (NOLOCK) inner join WC_ACTIVITY_F PAR (NOLOCK) on WC_ACTIVITY_F.ATTRIB_02 = PAR.INTEGRATION_ID inner join W_LOV_D LOV_STATUS (NOLOCK) on PAR.STATUS_WID = LOV_STATUS.ROW_WID inner join W_LOV_D LOV_TYPE_CD (NOLOCK) on PAR.ACT_TYPE_WID = LOV_TYPE_CD.ROW_WID where WC_ACTIVITY_F.ATTRIB_02 IS NOT NULL and ( ISNULL(WC_ACTIVITY_F.ATTRIB_122, '') <> ISNULL(LOV_STATUS.[NAME],'') or ISNULL(WC_ACTIVITY_F.ATTRIB_117, '1900-01-01 00:00:00') <> ISNULL(PAR.ATTRIB_114,'1900-01-01 00:00:00') or ISNULL(WC_ACTIVITY_F.ATTRIB_118, '1900-01-01 00:00:00') <> ISNULL(PAR.ATTRIB_115,'1900-01-01 00:00:00') or ISNULL(WC_ACTIVITY_F.ATTRIB_120, '1900-01-01 00:00:00') <> ISNULL(PAR.ACTUAL_START_DT,'1900-01-01 00:00:00') or ISNULL(WC_ACTIVITY_F.ATTRIB_121, '1900-01-01 00:00:00') <> ISNULL(PAR.ACTUAL_END_DT,'1900-01-01 00:00:00') or ISNULL(WC_ACTIVITY_F.ATTRIB_111, '') <> ISNULL(LOV_TYPE_CD.NAME,'') ) AND (EXISTS (SELECT 1 FROM WC_ACTIVITY_FS FS1 WHERE PAR.INTEGRATION_ID=FS1.INTEGRATION_ID OR WC_ACTIVITY_F.INTEGRATION_ID=FS1.INTEGRATION_ID));
--CHG098779 ETL MERGE INTO WC_ACTIVITY_F CHD1 USING ( SELECT CHD.ROW_WID ROW_WID, PAR.ROW_WID AS PAR_ACTIVITY_WID FROM WC_ACTIVITY_F CHD -- Child Records INNER JOIN WC_ACTIVITY_FS FS ON FS.INTEGRATION_ID=CHD.INTEGRATION_ID INNER JOIN WC_ACTIVITY_F PAR ON PAR.INTEGRATION_ID= CHD.ATTRIB_02 -- Child and Parent Relation WHERE CHD.ATTRIB_02 IS NOT NULL ) SRC ON (CHD1.ROW_WID = SRC.ROW_WID) WHEN MATCHED THEN UPDATE SET CHD1.PAR_ACTIVITY_WID = SRC.PAR_ACTIVITY_WID\;
UPDATE WC_ROUTING_VISIT_F SET COMMITED_FLG ='Y' WHERE ISNULL(COMMITED_FLG,'N') ='N' AND EXISTS (SELECT 1 FROM WC_ACTIVITY_FS, WC_ACTIVITY_F WHERE WC_ACTIVITY_FS.INTEGRATION_ID=WC_ACTIVITY_F.INTEGRATION_ID AND WC_ACTIVITY_F.ATTRIB_03=WC_ROUTING_VISIT_F.ACTIVITY_UID);
